    col2.setAttribute('class', 'listCol2');
    graph.setAttribute('class', 'listGraph');
    price.setAttribute('class', 'listPrice');
    performance.setAttribute('class', 'listPerformance');
    name.setAttribute('class', 'listName');
    fullName.setAttribute('class', 'listFullName');

    const localDataPoints = parseData(stockVariable);
    const closingPoints = localDataPoints[4], dataLength = closingPoints.length;
